import React from 'react';
import Timeline from '@material-ui/lab/Timeline';
import TimelineItem from '@material-ui/lab/TimelineItem';
import TimelineSeparator from '@material-ui/lab/TimelineSeparator';
import TimelineConnector from '@material-ui/lab/TimelineConnector';
import TimelineContent from '@material-ui/lab/TimelineContent';
import TimelineDot from '@material-ui/lab/TimelineDot';
import "./customTimeline.css"
import { Typography } from '@material-ui/core';

const customTimeline = ({title}) => {
    return (
        <Timeline className="timeline">
          
          <TimelineItem className="timeline_first_item">
            <TimelineSeparator>
              <TimelineDot className="timeline_dot_header"/>
              <TimelineConnector />
            </TimelineSeparator>
            <TimelineContent><Typography variant="h6" className="timeline_header">{title}</Typography></TimelineContent>
          </TimelineItem>

          <TimelineItem>
            <TimelineSeparator className="separator">
              <TimelineDot className="timeline_dot"/>
              <TimelineConnector />
            </TimelineSeparator>
            <TimelineContent>GitHub</TimelineContent>
          </TimelineItem>

          <TimelineItem>
            <TimelineSeparator>
              <TimelineDot className="timeline_dot"/>
            </TimelineSeparator>
            <TimelineContent>Linkedin</TimelineContent>
          </TimelineItem>

        </Timeline>
    );
}

export default customTimeline
